import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Navbar() {
  const [userName, setUserName] = useState('');
  const [isHovered, setIsHovered] = useState(false); // Track hover state
  const navigate = useNavigate();

  useEffect(() => {
    const storedUserName = localStorage.getItem('userName');
    if (storedUserName) {
      setUserName(storedUserName);
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('userName');
    setUserName('');
    navigate('/login');
  };

  // Styles for the navbar links and hover effect on the logout button
  const linkStyles = {
    fontSize: '1.1rem',
    fontWeight: '600',
    textTransform: 'uppercase',
    letterSpacing: '1px',
    padding: '8px 12px',
    transition: '0.3s ease',
    textDecoration: 'none',
    color: 'white',
  };

  const welcomeStyle = {
    color: 'white',
    fontSize: '1.1rem',
    backgroundColor: '#2980b9',
    padding: '5px 10px',
    borderRadius: '30px',
    fontWeight: '600',
    textTransform: 'uppercase',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    marginLeft: 'auto',
  };

  // Styles for the logout button with hover effect handled inline
  const logoutButtonStyles = {
    color: 'white',
    background: 'none',
    border: 'none',
    cursor: 'pointer',
    fontSize: '1.1rem',
    padding: '5px 15px',
    borderRadius: '20px',
    marginLeft: '10px',
    transition: '0.3s ease',
    backgroundColor: isHovered ? '#2980b9' : 'none', // Change background on hover
  };

  return (
    <nav
      className="navbar navbar-expand-lg navbar-dark"
      style={{
        backgroundColor: '#3498db',
        position: 'fixed',
        width: '100%',
        zIndex: '1000',
        padding: '10px 0',
        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
      }}
    >
      <div className="container-fluid">
        <a className="navbar-brand" href="#" style={{ fontSize: '1.8rem', fontWeight: 'bold' }}>
          Quiz App
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto" style={{ display: 'flex', justifyContent: 'center', marginTop: '0' }}>
            <li className="nav-item">
              <Link className="nav-link" to="/home" style={linkStyles}>
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/about" style={linkStyles}>
                About Us
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/quiz" style={linkStyles}>
                Quiz
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/profile" style={linkStyles}>
                Profile
              </Link>
            </li>

            {userName ? (
              <>
                <li className="nav-item ms-3">
                  <span
                    className="nav-link d-flex align-items-center"
                    style={welcomeStyle}
                  >
                    Welcome, <span style={{ fontWeight: 'bold' }}> {userName} </span>
                  </span>
                </li>
                <li className="nav-item ms-2">
                  <button
                    className="nav-link"
                    style={logoutButtonStyles}
                    onClick={handleLogout}
                    onMouseEnter={() => setIsHovered(true)} // Set hover state to true
                    onMouseLeave={() => setIsHovered(false)} // Set hover state to false
                  >
                    Logout
                  </button>
                </li>
              </>
            ) : (
              <li className="nav-item">
                <Link className="nav-link" to="/login" style={linkStyles}>
                  Login
                </Link>
              </li>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
